window.bookSummaryJSON = "<p><b>More than 150 million copies sold worldwide.</b></p> <p>Daunted by the singular tastes and dark secrets of the beautiful, tormented young entrepreneur Christian Grey, Anastasia Steele has broken off their relationship to start a new career with a Seattle publishing house. But desire for Christian still dominates her every waking thought, and when he proposes a new arrangement, Anastasia cannot resist.&nbsp;</p> <p>They rekindle their searing sensual affair, and Anastasia learns more about the harrowing past of her damaged, driven, and demanding Fifty Shades.&nbsp;</p> <p>While Christian wrestles with his inner demons, Anastasia must confront the anger and envy of the women who came before her, and make the most important decision of her life.</p> <p><b>This audiobook is intended for mature audiences. </b></p> <p>Look for E L Jamesâ€™ passionate new love story, <i>The Mister</i>, coming April 16, 2019.&nbsp;</p>"; 
